const ActionType = {
    INCREMENT : 'INCREMENT',
    DECREMENT : 'DECREMENT',
    ADD : 'ADD',
    SUBTRACT : 'SUBTRACT',
    RESET :'RESET',
    STORE_RESULT : 'STORE_RESULT',
    DELETE_RESULT : 'DELETE_RESULT',
}

// action creator 
export const increment = ( payload ) => {
    return {
        type:ActionType.INCREMENT
    }
}

export default ActionType;
